tables.table_schema:
CREATE TABLE WarrantyInformation (
    product_id UUID PRIMARY KEY,
    return_date DATE,
    warranty_status BOOLEAN
);

CREATE TABLE Warranty_Tracking (
    warranty_id UUID PRIMARY KEY,
    product_id UUID,
    return_date DATE,
    return_reason TEXT
);

CREATE TABLE WarrantyInformation (
    warranty_id UUID PRIMARY KEY,
    product_id UUID,
    return_date TIMESTAMP,
    reason TEXT
);

CREATE TABLE Product (
    product_id UUID PRIMARY KEY,
    product_name TEXT,
    product_description TEXT,
    manufacturer TEXT
);

CREATE TABLE ReturnProcessing (
    processing_id UUID PRIMARY KEY,
    warranty_id UUID,
    processing_date TIMESTAMP,
    processing_status TEXT
);

CREATE TABLE WarrantyProvider (
	provider_id INT PRIMARY KEY,
	provider_name VARCHAR(255) NOT NULL
);

CREATE TABLE Product (
	product_id INT PRIMARY KEY,
	product_name VARCHAR(255) NOT NULL,
	product_category VARCHAR(255)
);

CREATE TABLE ReturnRequest (
	request_id INT PRIMARY KEY,
	product_id INT REFERENCES Product(product_id),
	request_date DATE,
	return_reason TEXT
);

CREATE TABLE WarrantyClaim (
	claim_id INT PRIMARY KEY,
	request_id INT REFERENCES ReturnRequest(request_id),
	claim_date DATE,
	amount_reimbursed DECIMAL
);

CREATE TABLE ProductInventory (
	inventory_id INT PRIMARY KEY,
	product_id INT REFERENCES Product(product_id),
	quantity INT
);
